# 给你一个点数组 points 和一个表示角度的整数 angle ，你的位置是 location ，其中 location = [posx, posy] 且 points[i] = [xi, yi] 都表示 X-Y 平面上的整数坐标。
#
# 最开始，你面向东方进行观测。你 不能 进行移动改变位置，但可以通过 自转 调整观测角度。换句话说，posx 和 posy 不能改变。你的视野范围的角度用 angle 表示， 这决定了你观测任意方向时可以多宽。设 d 为你逆时针自转旋转的度数，那么你的视野就是角度范围 [d - angle/2, d + angle/2] 所指示的那片区域。
#
# 链接：https://leetcode-cn.com/problems/maximum-number-of-visible-points
import math


class Solution(object):
    def visiblePoints(self, points, angle, location):
        """
        :type points: List[List[int]]
        :type angle: int
        :type location: List[int]
        :rtype: int
        """

        degrees_arr = []
        flag = 0
        for point in points:
            if point[0] == location[0] and point[1] == location[1]:
                flag += 1
            else:
                degrees_arr.append(self.degrees(point, location))
        print(degrees_arr)
        degrees_arr = sorted(degrees_arr)
        print(degrees_arr)

        degrees_arr += [deg + 360 for deg in degrees_arr]
        print(degrees_arr)

        length = len(degrees_arr)
        result = 0
        r = 0
        for i in range(length):
            while r < length and degrees_arr[r] - degrees_arr[i] <= angle:
                r += 1
            result = max(result, r - i)
        return result + flag

    def degrees(self, a: list, location: list):
        return math.degrees(math.atan2(a[1] - location[1], a[0] - location[0]))


